import { useState } from 'react';
import { useMsal } from "@azure/msal-react";
import { loginRequest } from '../../AuthenticationFolder/authConfig'
import { callForUser } from "./GraphCalls"
import { GetEvent } from "./GetEvent";
import { useEffect } from "react";
import Grid from '@mui/material/Grid';
import Stack from '@mui/material/Stack';

import Moment from 'moment/moment';
import '../../stylesheets/event-box.css'

export function GetUsers(){        
    useEffect(() => {
        const interval = setInterval(() => {
            console.log('hej')
        }, 2000);
        return () => clearInterval(interval);
      }, []);
    //creates an object with instance and accounts that are authenticated.
    const { instance, accounts } = useMsal();

    const [event, setEvent] = useState([]);
  
    const time = Moment().format('LLL')

    const request = {
        ...loginRequest,
        account: accounts[0]
    };

    useEffect(() => {
        events()
    },[])

    const events = async () =>{
        var tokenProm = instance.acquireTokenSilent(request).then(async (res) => {return res.accessToken});
        tokenProm = await tokenProm;
    
        const users = await callForUser(tokenProm);

        const response = await GetEvent(users, instance, accounts);

        setEvent(await response);
    }
     return(
         <div>
             <h1>Alt her:</h1>
             {time}
             {event.map((data, index) => {
                if(data[0][0] !== undefined){
                const NA = Moment().to(Moment(data[0][0].start.dateTime).format('DD MMMM YYYY HH:MM')) <= Moment().to(Moment(data[0][0].start.dateTime).subtract(30, 'minutes').format('DD MMMM YYYY HH:MM'));
                    return(
                            <div className={NA ? "inTime" : "NA"} key={index}>
                                <li className="list-group-event">Name: {data[1]}</li>
                                <li>Subject: {data[0][0].subject}</li>
                                <li>Time: {Moment(data[0][0].start.dateTime).format('HH:MM')}</li>
                                <li>Time To: {Moment().to(Moment(data[0][0].start.dateTime).format('DD MMMM YYYY HH:MM'))}</li>
                                <br></br>
                            </div>
                    )
                }     
             })}
     </div>
     )
}
